import numpy as np
from PIL import Image
import cv2
import io

def display_image_from_bytes(byte_data):
    # Open the byte data as an image using PIL
    img = Image.open(io.BytesIO(byte_data))

    # Convert PIL image to numpy array
    img_array = np.array(img)

    # Convert RGB to BGR (OpenCV uses BGR)
    img_array = cv2.cvtColor(img_array, cv2.COLOR_RGB2BGR)

    # Display the image
    cv2.imshow('Image from Byte Data', img_array)
    cv2.waitKey(0)
    cv2.destroyAllWindows()

# Example byte data (replace it with your own)
data = b'\x00\x00\x00\x01\'d\x00(\xac+@(\x02'

display_image_from_bytes(data)
